import React from 'react'
import { useState } from 'react'
import Modal from 'react-modal'
import About from './About';

export default function Home() {
    const [modalisopen, setmodalisopen] = useState(false);
    const setmodalisopentotrue = () =>{
        setmodalisopen(true)
    }
    const setmodalisopentofalse = () =>{
        setmodalisopen(false)
    }
    return (
        <>
            <h1 className='heading'><center><span style={{ color: 'red' }}>K</span><span style={{ color: 'orange' }}>r</span><span style={{ color: 'yellow' }}>i</span><span style={{ color: '	#00FF00' }}>b</span><span style={{ color: '#00bfff' }}>b</span><span style={{ color: 'blue' }}>l</span><span style={{ color: '#FF1493' }}>e</span><span style={{ color: 'purple' }}>.</span><span style={{ color: 'white', fontSize: '5rem' }}>KK</span></center></h1>
            <input className='inputbaby' placeholder='Your Name...' type='text'></input>
            <button className='playbaby'><span style={{ fontSize: '1.1rem', fontFamily: 'fantasy' }}>Play !</span></button>

            <button className='btnbaby' onClick={setmodalisopentotrue}><span style={{ fontSize: '1.1rem', fontFamily: 'fantasy' }}>About</span></button>
            <Modal style={{ color }} isOpen={modalisopen}>
                <button className='xbaby' onClick={setmodalisopentofalse}>‚ùå</button>
                <About/>
            </Modal>
        </>
    )
}
